import{_ as Q,c as D,a1 as E,o as P}from"./chunks/framework.Bip4ku5S.js";const z=JSON.parse('{"title":"审核规范","description":"","frontmatter":{},"headers":[],"relativePath":"markdown-examples.md","filePath":"markdown-examples.md"}'),B={name:"markdown-examples.md"};function g(I,A,w,C,M,v){return P(),D("div",null,A[0]||(A[0]=[E('<p><strong>sparkpixel建筑建设与审核规范</strong></p><p><strong>1. 引言</strong></p><p>本规范旨在指导玩家在SparkPixel系列服务中的建筑行为，确保服务器的和谐与安全。所有玩家在使用服务器资源进行建筑活动时，必须遵守本规范。</p><h1 id="审核规范" tabindex="-1"><strong>审核规范</strong> <a class="header-anchor" href="#审核规范" aria-label="Permalink to &quot;**审核规范**&quot;">​</a></h1><p><strong>1. 建筑许可</strong></p><ul><li>所有建筑项目在施工前，必须获得服务器管理组的明确许可。</li><li>玩家可通过私信或其他有效方式提供的建筑申请渠道提交建筑计划，包括建筑位置、设计图、预计完工时间等信息。</li></ul><p><strong>3. 建筑位置与范围</strong></p><ul><li>建筑必须位于指定区域内，不得占用未开放或已禁止建设的土地。</li><li>建筑的高度和范围应符合服务器规划，避免对周边环境和资源造成破坏。</li></ul><p><strong>4. 建筑设计</strong></p><ul><li>建筑风格应与服务器环境协调一致，不得违反服务器的文化或审美标准。</li><li>建筑设计应避免过于复杂或不必要的结构，以减少维护成本和潜在的安全风险。</li><li>建筑设计不应该含有违反国家法律及我方及你的所在的的地方性法规与公序良俗。</li></ul><p><strong>5. 结构安全与稳定性</strong></p><ul><li>建筑必须使用适当的建筑材料，确保其结构稳定，支持与结构合理。</li><li>所有建筑物都应定期进行安全检查，修复发现的任何问题。</li></ul><p><strong>6. 资源利用与环境保护</strong></p><ul><li>施工时应避免破坏自然地貌和生态环境，保护生物多样性。</li><li>利用或排放任何自然资源时应该先行向管理组报备。</li></ul><ol start="7"><li><strong>审核流程</strong></li></ol><ul><li>所有建筑完工后，必须提交给服务器管理组进行正式审核。</li><li>在开工前也应该向管理组提供所需要的信息，待管理员同意后，方可开工。</li><li>管理组将根据本规范对建筑进行全面评估，并做出批准或拒绝的决定。</li><li>如果做出拒绝决定后，你可在7日内整改，拒不配合者我们有权删除其建筑。</li><li>在玩家提出申请后管理员应该在7日内接收验收数据，并且实地自行收集相关图片（5日内完成），移交管理群由所有管理进行会签（15日内完成）。</li></ul><p><strong>8. 违规处理</strong></p><ul><li>如果建筑未获得许可、违反设计规范或存在安全隐患，管理组有权要求立即停止施工或拆除建筑物。</li><li>对于重复违规的玩家，将采取更为严格的惩罚措施，包括但不限于封禁账号。</li></ul><p><strong>9. 申诉机制</strong></p><ul><li>对于审核结果有异议的玩家，有权向服务器管理组提出申诉。</li><li>申诉需提供详细的证据和解释，以便管理组进行全面复查。</li></ul><p><strong>10. 附则</strong></p><ul><li>本规范自发布之日起生效，并将定期进行更新以适应服务器的变化和发展。</li><li>本规范的解释权归服务器管理组所有。</li></ul><p>遵守本规范是每个SparkPixel系列服务玩家的责任，我们共同努力维护一个健康、有序的游戏环境。</p><h1 id="建设规范" tabindex="-1"><strong>建设规范</strong> <a class="header-anchor" href="#建设规范" aria-label="Permalink to &quot;**建设规范**&quot;">​</a></h1><h2 id="车站的建造" tabindex="-1"><strong>车站的建造</strong> <a class="header-anchor" href="#车站的建造" aria-label="Permalink to &quot;**车站的建造**&quot;">​</a></h2><p>车站在建造时需要使用<img src="data:image/png;base64," alt="descript">，并且两个轨道之间需要相隔<strong>至少6格，推荐8格</strong>，站台之间越宽，你在中间能放的额外的东西就越多。也可以让你的车站显得更加美观。车站的样子和规模应该在计划阶段就定下来。比如如果你这条线是比如乡下规模的那种，那么车站就可以造的简单一点，以木材、纯石材为车站的主要构成，没有那么多先进的车站设备。而如果你的车站是城市规模，那么车站从外观看起来就要不同，内部也包含电动手扶梯，直梯，信息中心等，更加现代，科技的建筑风格。（也别太未来）</p><h2 id="单线、双线建造标准-推荐性标准" tabindex="-1"><strong>单线、双线建造标准（推荐性标准）</strong> <a class="header-anchor" href="#单线、双线建造标准-推荐性标准" aria-label="Permalink to &quot;**单线、双线建造标准（推荐性标准）**&quot;">​</a></h2><p>双线示例：</p><p><img src="data:image/png;base64," alt="descript"></p><p>单线示例：</p><p><img src="data:image/png;base64," alt="descript"></p><p>我们不推荐使用单线铁路，因为间隔较大等原因。</p><h1 id="铁路建设规范" tabindex="-1"><strong>铁路建设规范：</strong> <a class="header-anchor" href="#铁路建设规范" aria-label="Permalink to &quot;**铁路建设规范：**&quot;">​</a></h1><h2 id="_1-疏散平台" tabindex="-1"><strong>1.疏散平台</strong> <a class="header-anchor" href="#_1-疏散平台" aria-label="Permalink to &quot;**1.疏散平台**&quot;">​</a></h2><p><img src="data:image/png;base64," alt="descript"></p><p>疏散平台应该距离轨道顶面小于1mm</p><p>（参照国标）</p><ol start="2"><li><h2 id="转弯半径" tabindex="-1"><strong>转弯半径</strong> <a class="header-anchor" href="#转弯半径" aria-label="Permalink to &quot;**转弯半径**&quot;">​</a></h2></li></ol><h3 id="_1-地铁标准-数据均为以上" tabindex="-1"><strong>1.地铁标准（数据均为以上）</strong> <a class="header-anchor" href="#_1-地铁标准-数据均为以上" aria-label="Permalink to &quot;**1.地铁标准（数据均为以上）**&quot;">​</a></h3><p><img src="data:image/png;base64," alt="descript"></p><h3 id="_2-350km以下-含-200km-h以上-含-高速铁路" tabindex="-1"><strong>2.350km以下（含）200km/h以上（含）高速铁路</strong> <a class="header-anchor" href="#_2-350km以下-含-200km-h以上-含-高速铁路" aria-label="Permalink to &quot;**2.350km以下（含）200km/h以上（含）高速铁路**&quot;">​</a></h3><p>一般7000米以上，困难5500米以上</p><h3 id="_2-350km以上-不含-400km-h以上-含-高速铁路" tabindex="-1"><strong>2.350km以上（不含）400km/h以上（含）高速铁路</strong> <a class="header-anchor" href="#_2-350km以上-不含-400km-h以上-含-高速铁路" aria-label="Permalink to &quot;**2.350km以上（不含）400km/h以上（含）高速铁路**&quot;">​</a></h3><p>一般8500米以上困难7500米以上</p><h2 id="最大坡度-数据均为以下-特殊标注除外" tabindex="-1"><strong>最大坡度（数据均为以下，特殊标注除外）</strong> <a class="header-anchor" href="#最大坡度-数据均为以下-特殊标注除外" aria-label="Permalink to &quot;**最大坡度（数据均为以下，特殊标注除外）**&quot;">​</a></h2><h3 id="_1-地铁标准" tabindex="-1"><strong>1.地铁标准</strong> <a class="header-anchor" href="#_1-地铁标准" aria-label="Permalink to &quot;**1.地铁标准**&quot;">​</a></h3><ol><li>正线坡度一般30‰，困难35‰，山地地形有较强依据使用40‰。</li><li>联络线使用40‰。</li><li>隧道最小坡度因该为3‰，困难最小坡度因该为2‰。</li></ol><h3 id="_2-350km以下-含-200km-h以上-含-高速铁路-1" tabindex="-1"><strong>2.350km以下（含）200km/h以上（含）高速铁路</strong> <a class="header-anchor" href="#_2-350km以下-含-200km-h以上-含-高速铁路-1" aria-label="Permalink to &quot;**2.350km以下（含）200km/h以上（含）高速铁路**&quot;">​</a></h3><h3 id="_20‰" tabindex="-1"><strong>20‰</strong> <a class="header-anchor" href="#_20‰" aria-label="Permalink to &quot;**20‰**&quot;">​</a></h3><h3 id="_2-350km以上-不含-400km-h以上-含-高速铁路-1" tabindex="-1"><strong>2.350km以上（不含）400km/h以上（含）高速铁路</strong> <a class="header-anchor" href="#_2-350km以上-不含-400km-h以上-含-高速铁路-1" aria-label="Permalink to &quot;**2.350km以上（不含）400km/h以上（含）高速铁路**&quot;">​</a></h3><p>一般15‰米困难20‰米</p><h2 id="区间标准" tabindex="-1"><strong>区间标准：</strong> <a class="header-anchor" href="#区间标准" aria-label="Permalink to &quot;**区间标准：**&quot;">​</a></h2><p>单个区间长度应该为当前线路最长车辆长度*2+最长刹车距离。</p><h2 id="折返线标准" tabindex="-1"><strong>折返线标准：</strong> <a class="header-anchor" href="#折返线标准" aria-label="Permalink to &quot;**折返线标准：**&quot;">​</a></h2><p>正如侧线与站台轨道的关系一样，折返线也需要与车身长度保持一致，否则可能导致车辆卡死等问题。举例来说，如果你的侧线长度为20格，那么折返线也应设计为20格。同时，如果车身较长（4编组以上），建议将侧线设置在距离上一个站点较远的地方，以便列车有足够的空间进行转向，避免车辆出现异常行为。折返线还需进行适当的装饰，以提升其正式感。此外，请使用单项轨道连接器链接上/下行和折返线之间的链接，这种单线轨道有助于确保列车按照正确的折返方向行驶。</p><p>注:本文档发布起即刻生效，本文档为强制性标准（特殊标注除外），你应该时刻注意本文的的更新，我们不在通知更新</p>',56)]))}const f=Q(B,[["render",g]]);export{z as __pageData,f as default};
